import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function ChartsOverviewDemo() {
  return (
    <BarChart
      series={[
        { data: [35, 44, 24, 34] },
        { data: [51, 6, 49, 30] },
        { data: [15, 25, 30, 50] },
        { data: [60, 50, 15, 25] },
      ]}
      height={290}
      xAxis={[{ data: [1, 2, 3, 4], scaleType: 'band' }]}  // Use numbers instead of strings
      margin={{ top: 10, bottom: 30, left: 40, right: 10 }}
    />
  );
}
